      <form action="" className={styles.formulario}>
        <div>
          <label htmlFor="">Email:</label>
          <input type="text" className={`form-control ${styles.input}`} value={userData.email} />
        </div>
        <div>
          <label htmlFor="">Password:</label>
          <input type="text" className={`form-control ${styles.input}`} value={userData.password}/>
        </div>
        <button onClick="" className="btn btn-primary mb-3">
          Submit
        </button>
      </form>
    </div>
  );
};

export default Form;
